



USE master
go

IF DB_ID('supertiendaONLINE') IS NOT NULL
	DROP DATABASE supertiendaONLINE;
GO

CREATE DATABASE supertiendaONLINE;
GO

SET DATEFORMAT dmy;  
GO 

USE supertiendaONLINE;
GO

--tabla clientes
IF OBJECT_ID('clientes')IS NOT NULL
	DROP TABLE clientes;
GO

CREATE TABLE clientes(
	clientesID INT IDENTITY NOT NULL PRIMARY KEY,
	nombre_cli VARCHAR(20) NOT NULL,
	apellido_cli VARCHAR(20) NOT NULL,
	direccion1_cli VARCHAR(100) NOT NULL,
	direccion2_cli VARCHAR(100) NULL,
	telefono_cli VARCHAR(13) NOT NULL, 
	email_cli VARCHAR(200) NOT NULL,
	password_cli VARCHAR(16) NOT NULL,
	
);

--tabla tarjeta
IF OBJECT_ID('tarjetas')IS NOT NULL
	DROP TABLE tarjetas;
GO

CREATE TABLE tarjetas(
	tarjetaID INT IDENTITY NOT NULL PRIMARY KEY,
	tipo_tarj VARCHAR(20) NOT NULL CONSTRAINT CK_tipo_tarjeta CHECK(tipo_tarj IN('VISA', 'MASTERCARD', 'AMERICA EXPRESS')), --VALIDACION VISA, MASTERCARD, AMERICA EXPRESS
	digitos_tarj VARCHAR(20) NOT NULL,
	mesExpe_tarj CHAR(2) NOT NULL,
	yearExpe_tarj CHAR(2) NOT NULL,
	
);
GO


--tabla tarjeta_cliente
IF OBJECT_ID('tarjetas_clientes') IS NOT NULL
	DROP TABLE tarjetas_clientes;
GO

CREATE TABLE tarjetas_clientes(
	tarjetaClienteID INT IDENTITY NOT NULL PRIMARY KEY,
	clientesID INT NOT NULL,
	tarjetaID INT NOT NULL, 
	fechaAgregada_tarj_clie DATETIME NOT NULL, --SET DATEFORMAT dmy;
	CONSTRAINT FK_tarjetacliente_clientes FOREIGN KEY(clientesID) REFERENCES clientes(clientesID) ON UPDATE CASCADE ON DELETE CASCADE,
	CONSTRAINT FK_tarjetacliente_tarjetas FOREIGN KEY(tarjetaID) REFERENCES tarjetas(tarjetaID) ON UPDATE CASCADE ON DELETE CASCADE
);
GO

--tabla pago
IF OBJECT_ID('pagos') IS NOT NULL
	DROP TABLE pagos;
GO

CREATE TABLE pagos(
	pagoID INT IDENTITY NOT NULL PRIMARY KEY,
	tipo_pago VARCHAR(12) NOT NULL,
	aprovador_pago CHAR(1) NOT NULL CONSTRAINT CK_pagos_aprobado CHECK( aprovador_pago IN('1','0') ),
);


--tabla ordenes
IF OBJECT_ID('ordenes') IS NOT NULL
	DROP TABLE ordenes;
GO

CREATE TABLE ordenes(
	ordenesID INT IDENTITY NOT NULL PRIMARY KEY,
	clientesID INT NOT NULL,
	pagoID INT NOT NULL,
	numeroOrden CHAR(8) NOT NULL, --PONER VALIDACION
	fecha_ordenes VARCHAR(12) NOT NULL,
	estado_ordenes VARCHAR(15) NOT NULL,
	ERROR_ordenes VARCHAR(50),
	ELIMINADA_ordenes CHAR(1) CONSTRAINT Ck_ordenes_eliminada CHECK( ELIMINADA_ordenes IN('1', '0') ), --VALIDAR 0 O 1
	CONSTRAINT FK_ordenes_clientes FOREIGN KEY(clientesID) REFERENCES clientes(clientesID) ON UPDATE CASCADE ON DELETE CASCADE,
	CONSTRAINT FK_ordenes_pagos FOREIGN KEY(pagoID) REFERENCES pagos(pagoID) ON UPDATE CASCADE ON DELETE CASCADE
);
GO


--tabla categoria 
IF OBJECT_ID('categorias') IS NOT NULL
	DROP TABLE categorias;
GO

CREATE TABLE categorias(
	categoriaID INT IDENTITY NOT NULL PRIMARY KEY,
	nombre_cate VARCHAR(30) NOT NULL,
	descripcion_cate VARCHAR(200),
	estado_cate CHAR(1) CONSTRAINT CK_categorias_estado_cate CHECK( estado_cate IN('1', '0') ) , --VALIDAR 1 O 0
);

--tabla proveedor
IF OBJECT_ID('proveedores') IS NOT NULL
	DROP TABLE proveedores;
GO

CREATE TABLE proveedores(
	proveedorID INT IDENTITY NOT NULL PRIMARY KEY,
	nombre_provee VARCHAR(100) NOT NULL,
	direccion_provee VARCHAR(250),
	estado_provee CHAR(1) CONSTRAINT CK_proveedores_estado_provee CHECK( estado_provee IN('1', '0') ) --VALIDAR 1 PARA ACTIVO 0 PARA INACTIVO 
);
GO

--tabla productos
IF OBJECT_ID('productos') IS NOT NULL
	DROP TABLE productos;
GO

CREATE TABLE productos(
	productoID INT IDENTITY NOT NULL PRIMARY KEY,
	categoriaID INT NOT NULL,
	proveedorID	INT NOT NULL, 
	nombre_prod VARCHAR(50) NOT NULL,
	descripcion_prod VARCHAR(250) NOT NULL,
	precio_unidad_prod DECIMAL(4,2) NOT NULL CONSTRAINT CK_productos_precio_unidad_prod CHECK( precio_unidad_prod > 0 ), --MAYOR QUE CERO
	unidad_prod	INT NOT NULL CONSTRAINT CK_productos_unidad_prod CHECK( unidad_prod >= 0 ) , --MAYOR O IGUAL QUE CERO
	descuento_prod DECIMAL(4,2),
	foto_prod VARCHAR(250),
	CONSTRAINT FK_productos_categoria FOREIGN KEY(categoriaID) REFERENCES categorias(categoriaID) ON UPDATE CASCADE ON DELETE CASCADE,
	CONSTRAINT FK_productos_proveedor FOREIGN KEY(proveedorID) REFERENCES proveedores(proveedorID) ON UPDATE CASCADE ON DELETE CASCADE
);

--tabla orden_detalle
IF OBJECT_ID('orden_detalles') IS NOT NULL
	DROP TABLE orden_detalles;
GO

CREATE TABLE orden_detalles(
	ordenDetallesID INT IDENTITY NOT NULL PRIMARY KEY, 
	ordenesID INT NOT NULL,
	productoID INT NOT NULL,
	precio_orden DECIMAL(6,2) NOT NULL CONSTRAINT CK_orden_detalles_precio_orden CHECK( precio_orden > 0 ), --VALIDAR ARRIBA DE 0
	cantidad_orden INT NOT NULL CONSTRAINT CK_orden_detalles_cantidad_orden CHECK( cantidad_orden >= 0 ), --ARRIBA DE 0
	descuento_orden DECIMAL(6,2),
	CONSTRAINT FK_ordendetalles_ordenes FOREIGN KEY(ordenesID) REFERENCES ordenes(ordenesID) ON UPDATE CASCADE ON DELETE CASCADE,
	CONSTRAINT FK_ordendetalles_productos FOREIGN KEY(productoID) REFERENCES productos(productoID) ON UPDATE CASCADE ON DELETE CASCADE
	
);

select COUNT(productoID) from productos

