---EXISTS Y NOT EXISTS

select c.nombre_cli, COUNT(*) AS Total_clientes from clientes c
	where exists  (
		select p.pagoID from pagos p
			where p.pagoID in (select o.pagoID from ordenes o 
				where o.clientesID in (select c.clientesID from clientes c)
			)
	)
		group by c.nombre_cli

		
		
	
select c.nombre_cli, COUNT(*) AS Total_clientes from clientes c
	where not exists  (
		select p.pagoID from pagos p
			where p.pagoID in (select o.pagoID from ordenes o 
				where o.clientesID in (select c.clientesID from clientes c)
			)
	)
		group by c.nombre_cli
		
		
		
select o.ordenesID from ordenes o
	where EXISTS (select * from pagos p where p.pagoID = o.pagoID and p.aprovador_pago = 1)



